import React, { Component } from 'react';
import { Text, Div} from "atomize";


class Description extends React.Component {

    render() { 

        return (
            <Div 
                bg="black" textColor="white" m={{ b: "2rem" }}>
                    <Text>
                    <Text>Dumb Donuts is a collection of NFTs (unique digital collectibles) based on the works of CryptoPunks and Weird Whales.</Text>
                    <Text>10,000 donuts have been generated from a buffet of combinations, each with unique traits.</Text>
                    <Text>Treat yourself to a dumb donut today!</Text>
                    </Text>

            </Div>
            )
    }
}

export default Description;
